	// 			<Route path="/" element={ <NotFound/>}></Route>
	// 			<Route path="/live" element={ <Home/>}></Route>
	// 			<Route path="*" element={ <NotFound/>}></Route>
	// 		</Routes>
	// 	</BrowserRouter>
	// );

	return (
		<Panels
			{...props}
			skinVariants={skinVariants}
			onBack={()=>{}}
			onClose={()=>{}}
		>
			<Main />
		</Panels>
	);
};

export default ThemeDecorator(App);
